import React from "react";
import Netflix from "./Netflix";
import Amazon from "./Amazon";


const favseries = 'youtube';

const Net =()=>
(
    <div>

    <h1 className ="heading_style">List of top 5 Netflix in 2020</h1>
   
   {  (favseries == "netflix") ? <Netflix/> : <Amazon/>}
    </div>
   
   
    );

    export default Net;
